import './App.css';
import Nav from './assets/components/common/Nav'
import Login from './assets/components/common/Login';
import Footer from './assets/components/common/Footer';
import ServiceIntro from './assets/components/mainPage/ServiceIntro';

function App() {
  return (
    <div className="App">
      <Nav />
      <ServiceIntro/>
      <Footer/>
    </div>
  );
}

export default App;
